var findKthLargest = function(nums, k) {
    const heap = new Heap((a, b) => a < b);
    for (const num of nums) {
        heap.add(num);
    }

    for (let i = 0; i < k - 1; i++) {
        heap.poll();
    }

    return heap.poll();
};

class Solution {
    public int findKthLargest(int[] nums, int k) {
        Queue<Integer> queue = new PriorityQueue<>((a, b) -> b - a);
        for (int num : nums) {
            queue.offer(num);
        }
        for (int i = 0; i < k - 1; i++) {
            queue.poll();
        }
        return queue.peek();
    }
}

